// A real test generated by loop unrolling
int a[100UL][100UL];

int main()
{
  int j;
  for (int i = 0; i < 100; i++) {
    int _lu_fringe = (((100 - 1 + 1 - 0) % 1 == 0?(100 - 1 + 1 - 0) / 1 : (100 - 1 + 1 - 0) / 1 + 1)) % 5 == 0?0 : 5 * 1;
    for (j = 0; j <= 100 - 1 - _lu_fringe; j += 1 * 5) {
      int k = 3;
      (a[i])[j] = ((i + j) + k);
      {
        int k = 3;
        (a[i])[(j + 1 * 1)] = ((i + (j + 1 * 1)) + k);
      }
      {
        int k = 3;
        (a[i])[(j + 1 * 2)] = ((i + (j + 1 * 2)) + k);
      }
      {
        int k = 3;
        (a[i])[(j + 1 * 3)] = ((i + (j + 1 * 3)) + k);
      }
      {
        int k = 3;
        (a[i])[(j + 1 * 4)] = ((i + (j + 1 * 4)) + k);
      }
    }
    for (; j <= 100 - 1; j += 1) {
      int k = 3;
      (a[i])[j] = ((i + j) + k);
    }
  }
  return 0;
}


